import React, { useState } from "react";
import styled from "styled-components";
import { useAuth } from "./AuthProvider";
import { useNavigate } from "react-router-dom";

const PageWrapper = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background: #fff;
  position: relative;
  overflow: hidden;
`;

const StyledForm = styled.form`
  background: white;
  padding: 50px 40px;
  border-radius: 12px;
  box-shadow: 0 8px 24px rgba(0, 0, 0, 0.08);
  max-width: 400px;
  width: 100%;
  z-index: 2;
`;

const Title = styled.h2`
  text-align: center;
  font-size: 26px;
  font-weight: bold;
  margin-bottom: 30px;
`;

const Label = styled.label`
  font-weight: 500;
  font-size: 14px;
  margin-bottom: 5px;
  display: block;
`;

const Input = styled.input`
  width: 100%;
  padding: 12px;
  margin-bottom: 20px;
  border-radius: 6px;
  border: 1px solid #ccc;
  background: #f4f4f4;

  &:focus {
    border-color: #f0c330;
    outline: none;
  }
`;

const CheckboxWrapper = styled.div`
  margin-bottom: 20px;
  font-size: 14px;

  input {
    margin-right: 8px;
  }
`;

const Button = styled.button`
  width: 100%;
  background: #f0c330;
  color: black;
  font-weight: 600;
  font-size: 16px;
  padding: 12px;
  border: none;
  border-radius: 6px;
  cursor: pointer;

  &:hover {
    background: #ddb21f;
  }
`;

const LinkText = styled.p`
  text-align: center;
  margin-top: 16px;
  font-size: 14px;
  color: #555;

  a {
    color: #333;
    text-decoration: none;

    &:hover {
      text-decoration: underline;
    }
  }
`;

const ErrorMessage = styled.div`
  background: #ffe2e2;
  color: #d8000c;
  padding: 12px;
  border-radius: 6px;
  margin-bottom: 20px;
  text-align: center;
  font-size: 14px;
`;

const LoginForm = () => {
  const { login } = useAuth();
  const navigate = useNavigate();
  const [form, setForm] = useState({ email: "", password: "" });
  const [rememberMe, setRememberMe] = useState(false);
  const [error, setError] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");

    try {
      await login(form);
      navigate("/");
    } catch (err) {
      try {
        const parsed = JSON.parse(err.message);
        setError(parsed.message || "Échec de connexion");
      } catch {
        setError("Échec de connexion");
      }
    }
  };

  return (
    <PageWrapper>
      <StyledForm onSubmit={handleSubmit}>
        <Title>Welcome Back</Title>

        {error && <ErrorMessage>{error}</ErrorMessage>}

        <Label>Email *</Label>
        <Input
          type="email"
          placeholder="Enter your Email"
          value={form.email}
          onChange={(e) => setForm({ ...form, email: e.target.value })}
          required
        />

        <Label>Password *</Label>
        <Input
          type="password"
          placeholder="Enter your Password"
          value={form.password}
          onChange={(e) => setForm({ ...form, password: e.target.value })}
          required
        />

        <CheckboxWrapper>
          <input
            type="checkbox"
            checked={rememberMe}
            onChange={(e) => setRememberMe(e.target.checked)}
          />
          Remember me
        </CheckboxWrapper>

        <Button type="submit">Login</Button>

        <LinkText>
          <a href="#">Forgot password?</a>
        </LinkText>
        <LinkText>
          Don’t have an account? <a href="#">Sign up</a>
        </LinkText>
      </StyledForm>
    </PageWrapper>
  );
};

export default LoginForm;
